document.addEventListener("submit",n=>{console.log("Axios Submit.");const t=n.target,i=new FormData(t);axios.request({url:t.action,method:t.method,data:i,headers:{"Content-Type":"multipart/form-data"}}).then(n=>{n.data.redirectTo&&(window.location.href=n.data.redirectTo)}).catch(n=>{console.log(n)});n.preventDefault()});